import React from 'react';
import { useNavigate } from 'react-router-dom';

const projects = [
  { id: 1, title: 'Test 1', description: 'This is donation test 1.' },
  { id: 2, title: 'Test 2', description: 'This is donation test 2.' },
];

function Main() {
  const navigate = useNavigate();

  return (
    <div style={{ padding: '2rem' }}>
      <h2 style={{ textAlign: 'center' }}>üî• ÏßÄÏõê Í∞ÄÎä•Ìïú ÌîÑÎ°úÏ†ùÌä∏</h2>
      <div style={{ display: 'flex', gap: '2rem', justifyContent: 'center', marginTop: '2rem' }}>
        {projects.map((project) => (
          <div
            key={project.id}
            style={{
              border: '1px solid #ccc',
              borderRadius: '1rem',
              padding: '1rem',
              width: '250px',
              cursor: 'pointer',
            }}
            onClick={() => navigate(`/project/${project.id}`)}
          >
            <h3>{project.title}</h3>
            <p>{project.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Main;
